INSERT INTO `skill_template` (`id`, `class`, `name`, `max_point`, `type`, `icon`, `description`) VALUES
(0, 0, 'Chiêu cơ bản', 0, 1, 318, 'Đòn đánh cơ bản sử dụng sức mạnh bản thân gây sát thương lên kẻ địch'),
(1, 1, 'Chiêu Hiyoko', 12, 1, 319, 'Kiếm pháp nhập môn - vung kiếm vào một mục tiêu gây sát thương lên mục tiêu đó'),
(2, 1, 'Chiêu Amagedon', 6, 0, 601, 'Nhẫn thuật tâm pháp - nâng cao khả năng tấn công và phòng thủ'),
(3, 1, 'Chiêu Jizokuzan', 12, 1, 320, 'Chém liên tục 3 nhát kiếm gây sát thương cho một mục tiêu nhất định'),
(4, 1, 'Chiêu Kakyuu', 6, 3, 602, 'Sử dụng hỏa thuật thiêu đốt quái vật biến chúng thành thức ăn'),
(5, 1, 'Chiêu X Zangeki', 12, 1, 321, 'Xuất ra đường kiếm nhanh nhẹn đan chéo gây sát thương tối đa lên 3 mục tiêu'),
(6, 1, 'Chiêu Raikou', 6, 2, 603, 'Làm cho bản thân tàng hình trước kẻ thù đồng thời gây chí mạng ở nhát đánh đầu tiên trong trạng thái tàng hình'),
(7, 1, 'Chiêu Hihebun', 12, 1, 322, 'Tạo ra cơn mưa kiếm, gây sát thương cực lớn lên một mục tiêu'),
(8, 1, 'Chiêu Shuurai', 6, 0, 604, 'Tăng khả năng kháng phong đồng thời giúp bản thân nhanh chóng hồi phục khi bị choáng'),
(9, 1, 'Chiêu Choukouhirenzo', 12, 1, 323, 'Xuất ra 3 hỏa kiếm cường mạnh gây sát thương trong một phạm vi nhất định, tối đa 4 mục tiêu'),
(10, 2, 'Chiêu Otama', 12, 1, 596, 'Tiêu thuật nhập môn - phóng phi tiêu gây sát thương lên một mục tiêu nhất định'),
(11, 2, 'Chiêu Itotama', 6, 0, 621, 'Nhẫn thuật tâm pháp - nâng cao khả năng tấn công và phản đòn'),
(12, 2, 'Chiêu Kasoushuriken', 12, 1, 597, 'Phóng 2 phi tiêu liên tục gây sát thương cho một mục tiêu nhất định'),
(13, 2, 'Chiêu Taiyoutama', 6, 2, 622, 'Sử dụng hỏa thuật triều hồi vòng lửa vô hình thiêu đốt các mục tiêu bản thân tấn công'),
(14, 2, 'Chiêu Bikoushuriken', 12, 1, 598, 'Vận dụng hỏa thuật đốt cháy phi tiêu phóng đi gây sát thương tối đa lên 3 mục tiêu'),
(15, 2, 'Chiêu Hoshitama', 6, 2, 623, 'Sử dụng ẩn thân thuật để bản thân trở nên vô hình đồng thời hồi phục hp và mp trong một thời gian xác định'),
(16, 2, 'Chiêu Hinotama', 12, 1, 599, 'Trong chớp mắt phóng 2 phi tiêu bốc cháy về phía kẻ địch, gây ra lượng sát thương cực lớn'),
(17, 2, 'Chiêu Hijoukai', 6, 0, 624, 'Tăng khả năng kháng phong đồng thời giúp bản thân nhanh chóng hồi phục khi bị choáng'),
(18, 2, 'Chiêu Choukou shuriken', 12, 1, 600, 'Phóng ra một Phi Tiêu lớn kèm theo lửa gây sát thương trong một phạm vi nhất định, tối đa 4 mục tiêu'),
(19, 3, 'Chiêu Yokobatan', 12, 1, 550, 'Kunai nhập môn - tấn công gây sát thương lên một mục tiêu nhất định'),
(20, 3, 'Chiêu Akaiame', 6, 0, 605, 'Nhẫn thuật tâm pháp - nâng cao khả năng tấn công độ chính xác và tốc độ di chuyển'),
(21, 3, 'Chiêu Mizuibatan', 12, 1, 577, 'Chém liên tục vào mục tiêu gây sát thương lên mục tiêu đó'),
(22, 3, 'Chiêu Aoiame', 6, 2, 606, 'Tạo ra khúc gỗ thế thân chịu mọi sát thương thay cho bản thân'),
(23, 3, 'Chiêu Uzubatan', 12, 1, 578, 'Kunai kết hợp băng thuật tạo ra vòng sát thương tác động lên các mục tiêu cạnh đó, tối đa 3 mục tiêu'),
(24, 3, 'Chiêu Hibikou', 6, 1, 607, 'Sử dụng cầm băng thuật trói chân kẻ địch trong một khoảng thời gian nhất định'),
(25, 3, 'Chiêu Kogoeru', 12, 1, 579, 'Tạo 2 vòng băng quấn quanh mục tiêu, gây ra sát thương cực lớn'),
(26, 3, 'Chiêu Jotente', 6, 0, 608, 'Tăng khả năng kháng hỏa đồng thời giúp bản thân nhanh chóng hồi phục khi bị bỏng'),
(27, 3, 'Chiêu Choukoukogo', 12, 1, 580, 'Tạo ra vòng băng cuộn về phía trước gây sát thương trong một phạm vi nhất định, tối đa 4 mục tiêu'),
(28, 4, 'Chiêu Uzusa', 12, 1, 586, 'Cung thuật nhập môn - bắn một mũi tên gây sát thương lên một mục tiêu nhất định'),
(29, 4, 'Chiêu Washihitomi', 6, 0, 613, 'Nhẫn thuật tâm pháp - nâng cao sức tấn công và độ chính xác bản thân'),
(30, 4, 'Chiêu Kinkinsa', 12, 1, 587, 'Bắn ra một mũi tên băng vào mục tiêu gây sát thương ngay lập tức'),
(31, 4, 'Chiêu Sogekihei', 6, 2, 614, 'Nhẫn thuật tiêu tốn MP giảm sức sát thương của quái vật lên bản thân'),
(32, 4, 'Chiêu Nikinkinsa', 12, 1, 588, 'Bắn ra 2 mũi tên băng gây sát thương trong một phạm vi nhất định, sát thương tối đa 3 mục tiêu'),
(33, 4, 'Chiêu Joutenhitomi', 6, 2, 615, 'Sử dụng băng tâm thuật gia tăng mạnh mẽ sức tấn công nhưng bản thân phải chịu tổn thương'),
(34, 4, 'Chiêu Kogosa', 12, 1, 589, 'Băng thuật cô đọng hơi nước xung quanh tạo ra mũi tên băng bắn vào kẻ địch, gây sát thương cực lớn'),
(35, 4, 'Chiêu Kyshouma', 6, 0, 616, 'Tăng khả năng kháng hỏa đồng thời giúp bản thân nhanh chóng hồi phục khi bị bỏng'),
(36, 4, 'Chiêu Chousoukinkinsa', 12, 1, 590, 'Bắn ra 3 mũi tên băng về phía mục tiêu đồng thời gây ra sát thương lên các mục tiêu lân cận, tối đa 4 mục tiêu'),
(37, 5, 'Chiêu Enchokuto', 12, 1, 581, 'Đao pháp nhập môn - dùng đao chém mạnh vào một mục tiêu gây sát thương lên mục tiêu đó'),
(38, 5, 'Chiêu Konoitoame', 6, 0, 609, 'Nhẫn thuật tâm pháp - nâng cao sức tấn công, HP và tốc độ di chuyển'),
(39, 5, 'Chiêu Maroyakato', 12, 1, 582, 'Chém 2 nhát Đao liên tiếp vào mục tiêu gây sát thương lên mục tiêu đó'),
(40, 5, 'Chiêu Magumandari', 6, 3, 610, 'Khiến cho quái vật bị tác động không thể tấn công trong một thời gian nhất định'),
(41, 5, 'Chiêu Chousouto', 12, 1, 583, 'Kết hợp phong thuật vung đao về phía kẻ địch gây sát thương trong phạm vi nhất định, sát thương tối đa 3 mục tiêu'),
(42, 5, 'Chiêu Aisubaagu', 6, 1, 611, 'Sử dụng dịch phong thuật nhanh chóng áp sát và tấn công kẻ thù ngay lập tức'),
(43, 5, 'Chiêu Hayateto', 12, 1, 584, 'Nhát chém kèm thèo gió và sấm sét giáng thẳng vào mục tiêu, gây ra sát thương cực lớn'),
