(45, 5, 'Chiêu Raikouto', 12, 1, 585, 'Vung đao xuất ra luồng sét đánh thẳng vào mục tiêu, đồng thời gây sát thương các mục tiêu lân cận, tối đa 4 mục tiêu'),
(46, 6, 'Chiêu Ouchia', 12, 1, 591, 'Quạt mạnh tạo ra luồng gió tấn công thẳng vào một mục tiêu, gây sát thương lên mục tiêu đó'),
(47, 6, 'Chiêu Suishou', 6, 2, 617, 'Trong mỗi giây hồi phục cho bản thân và đồng đội một lượng máu nhất định'),
(48, 6, 'Chiêu Oouchia', 12, 0, 592, 'Nhẫn thuật tâm pháp - nâng cao lượng HP, MP và kinh nghiệm khi đánh quái'),
(49, 6, 'Chiêu Kusenmono', 6, 4, 619, 'Trong tích tắc hồi phục cho một mục tiêu đang trong trạng thái kiệt sức, đồng thời gia tăng né tránh'),
